Cold start for day 2 of Downed Officer in Franklin, TN. Led by Medical instructor Paul and CQB instructor Steve, Downed Officer combines shooting with the phases of care, priorities of threats, and casualty evacuation. Day 1 focuses on building the basics of stabilizing a casualty through the M-A-R-C-H algorithm, with plenty of opportunities to get hands on experience through periods of instruction. This course focuses on the medical aspect first, the tactical aspect will support the medical training. During day 2, we will begin to apply and evaluate the skills learned on day 1, while being able to give students the ability to work through numerous drills/scenarios. This day will build on shooting, cover and concealment, movement and communication while providing aid. We want you to be able to know the “why” as well as the “how” and “what”. The ability to perform under different types of stress is instilled  both days.
